import React from 'react';
import FundSelection from "./FundSelection";
import Frequency from "./frequency";
import Logo from "./Logo";

function App() {
  return (
    <div className="App">
      <FundSelection />
      <Frequency />
      <Logo prefix="194" bucketName="max-client-logo" />
    </div>
  );
}

export default App;
